import React, { useState } from 'react';
import ProjectName from './project-name';

export default function Main(props: any) {
  const [view, setView] = useState('project-name' as string);

  let element = null;
  switch (view) {
    case 'project-name':
      element = <ProjectName />;
  }

  return <></>;
}
